// InsuranceFeeDecorator.js
class InsuranceFeeDecorator {
    constructor(booking) {
        this.booking = booking;
    }

    calculateTotal() {
        const price = this.booking.price;
        const insuranceFee = 0.05 * price;
        return this.booking.calculateTotal() + insuranceFee;
    }
}

export default InsuranceFeeDecorator;
